import * as ReactDOM from 'react-dom';
import * as React from 'react';
import { updateSampleSection } from '../common/sample-base';
import { DocumentEditorContainerComponent, Toolbar, CommentDeleteEventArgs } from '@syncfusion/ej2-react-documenteditor';
import { TitleBar } from './title-bar';
import { DialogUtility } from '@syncfusion/ej2-popups';
import './default.component.css';
DocumentEditorContainerComponent.Inject(Toolbar);
// tslint:disable:max-line-length
function Comments() {
    React.useEffect(() => {
        updateSampleSection();
        rendereComplete();
    }, [])
    let hostUrl: string = 'https://services.syncfusion.com/react/production/api/documenteditor/';
    let container: DocumentEditorContainerComponent;
    let titleBar: TitleBar;
    function rendereComplete(): void {
        window.onbeforeunload = function () {
            return 'Want to save your changes?';
        }
        container.documentEditor.pageOutline = '#E0E0E0';
        container.documentEditor.acceptTab = true;
        container.documentEditor.resize();
        titleBar = new TitleBar(document.getElementById('documenteditor_titlebar'), container.documentEditor, true);
        onLoadDefault();
    }
    return (<div className='control-pane'>
        <div className='control-section'>
            <div id='documenteditor_titlebar' className="e-de-ctn-title"></div>
            <div id="documenteditor_container_body">
                <DocumentEditorContainerComponent id="container" ref={(scope) => { container = scope; }} style={{ 'display': 'block' }}
                    height={'590px'} serviceUrl={hostUrl} enableToolbar={true} showPropertiesPane={false} locale='en-US' userColor='#b70f34' currentUser='Nancy Davolio' />
            </div>
        </div>
        <div id="action-description">
            <p>This example demonstrates the comments only type of document protection which allows users to add or edit comments alone in the document. To unprotect the document, use password '123'..</p>
        </div>
        <div id="description">
            <div>
                <p>In this example, comments features in the document editor can be found.</p>
                <ul>
                    <li>Add or edit a comment.</li>
                    <li>Reply to a comment.</li>
                    <li>Resolving the comment discussion.</li>
                </ul>
                <p style={{ 'display': 'block' }}> More information about the document editor features can be found in this <a target="_blank" href="https://ej2.syncfusion.com/react/documentation/document-editor/comments/">documentation section.</a>
                </p>
            </div>
        </div>
    </div>);
    function onLoadDefault(): void {
        // tslint:disable
        let defaultDocument: object ={"sfdt":""};
        // tslint:enable        
        container.documentEditor.open(JSON.stringify(defaultDocument));
        container.documentEditor.documentName = 'Comments';
        container.documentEditor.showComments = true;
        titleBar.updateDocumentTitle();
        container.documentChange = (): void => {
            titleBar.updateDocumentTitle();
            container.documentEditor.focusIn();
        };
        container.commentDelete = (args: CommentDeleteEventArgs): void => {
            if (args.author !== container.documentEditor.currentUser) {
                args.cancel = true;
                DialogUtility.alert({
                    title: 'Information',
                    content: "Delete restriction enabled. Only the author of the comment can delete it.",
                    showCloseIcon: true,
                    closeOnEscape: true,
                });
            }
        }

    }
}
export default Comments;
